def pushIfPossible(direction: number):
    global locationInDirection, pushedLocationInDirection
    locationInDirection = grid.add(grid.get_location(playerSprite),
        DIRECTION_VECTORS[direction][0],
        DIRECTION_VECTORS[direction][1])
    pushedLocationInDirection = grid.add(grid.get_location(playerSprite),
        DIRECTION_VECTORS[direction][0] * 2,
        DIRECTION_VECTORS[direction][1] * 2)
    if tiles.tile_at_location_equals(locationInDirection, assets.tile("""
        myTile0
    """)) or tiles.tile_at_location_equals(locationInDirection, sprites.dungeon.stair_ladder):
        if not (tiles.tile_at_location_is_wall(pushedLocationInDirection)):
            if tiles.tile_at_location_equals(locationInDirection, assets.tile("""
                myTile0
            """)):
                tiles.set_tile_at(locationInDirection, sprites.dungeon.floor_dark_diamond)
            else:
                tiles.set_tile_at(locationInDirection, sprites.dungeon.floor_dark2)
            tiles.set_wall_at(locationInDirection, False)
            if tiles.tile_at_location_equals(pushedLocationInDirection,
                sprites.dungeon.floor_dark_diamond):
                tiles.set_tile_at(pushedLocationInDirection, assets.tile("""
                    myTile0
                """))
            else:
                tiles.set_tile_at(pushedLocationInDirection, sprites.dungeon.stair_ladder)
            tiles.set_wall_at(pushedLocationInDirection, True)
            return True
    return False
def checkWin():
    global canMove
    if len(tiles.get_tiles_by_type(sprites.dungeon.floor_dark_diamond)) == 0:
        canMove = False
        playerSprite.say_text("Yay~")
        pause(1000)
        成功()
        game.over(True)

