def onDirectionButtonDown(direction2: number, spriteImage: Image):
    if canMove:
        playerSprite.set_image(spriteImage)
        if checkWall(direction2):
            if checkBox(direction2):
                if pushIfPossible(direction2):
                    info.change_score_by(-1)
                    grid.move(playerSprite,
                        DIRECTION_VECTORS[direction2][0],
                        DIRECTION_VECTORS[direction2][1])
                    checkWin()
                    lose()
        else:
            info.change_score_by(-1)
            grid.move(playerSprite,
                DIRECTION_VECTORS[direction2][0],
                DIRECTION_VECTORS[direction2][1])
            lose()
def initConstants():
    global UP, RIGHT, DOWN, LEFT, DIRECTION_VECTORS
    UP = [0, -1]
    RIGHT = [1, 0]
    DOWN = [0, 1]
    LEFT = [-1, 0]
    DIRECTION_VECTORS = [UP, RIGHT, DOWN, LEFT]
# 0 - up
# 1 - right
# 2 - down
# 3 - left
def checkBox(direction3: number):
    return tiles.tile_at_location_equals(grid.add(grid.get_location(playerSprite),
            DIRECTION_VECTORS[direction3][0],
            DIRECTION_VECTORS[direction3][1]),
        assets.tile("""
            myTile0
        """)) or tiles.tile_at_location_equals(grid.add(grid.get_location(playerSprite),
            DIRECTION_VECTORS[direction3][0],
            DIRECTION_VECTORS[direction3][1]),
        sprites.dungeon.stair_ladder)
def lose():
    global canMove
    if info.score() == 0:
        canMove = False
        playerSprite.say_text("QQ")
        pause(1000)
        game.over(False)

